import React, { useState } from 'react';
import '../../App.css';

function Nav() {
  const [showKafedra, setShowKafedra] = useState(false);
  const [showBagytary, setShowBagytary] = useState(false);

  const handleKafedraClick = () => {
    setShowKafedra(!showKafedra);
    setShowBagytary(false);
  };

  const handleBagytaryClick = () => {
    setShowBagytary(!showBagytary);
    setShowKafedra(false);
  };

  return (
    <nav id="nav">
      <ul>
        <li>
          <button
            className={`nav_link ${showKafedra ? 'active' : ''}`}
            onClick={handleKafedraClick}
          >
            Кафедра
          </button>
          {showKafedra && (
            <div className="hiddenDiv">
              <ul>
                <li>
                  <a href="">Тарыхы</a>
                </li>
                <li>
                  <a href="">Курамы</a>
                </li>
                <li>
                  <a href="">Аккредитация</a>
                </li>
              </ul>
            </div>
          )}
        </li>
        <li>
          <button
            className={`nav_link ${showBagytary ? 'active' : ''}`}
            onClick={handleBagytaryClick}
          >
            Багыттары
          </button>
          {showBagytary && (
            <div className="hiddenDiv">
              <ul>
                <li>
                  <a href="">Графика</a>
                </li>
                <li>
                  <a href="">Информатика жана Эсептөө техникасы</a>
                </li>
              </ul>
            </div>
          )}
        </li>
        <li>
          <button className="nav_link">Жанылыктар</button>
        </li>
        <li>
          <button className="nav_link">Иш-чаралар</button>
        </li>
        <li>
          <button className="nav_link">Байланыш үчүн</button>
        </li>
      </ul>
    </nav>
  );
}

export default Nav;
